description:
Artist  : Various
Album   : Now That's What I Call Music! 5
Date    : 1985
Bitrate : vbr

Now That's What I Call Music 5 or Now 5 was released in 1985. 
The album is the fifth edition of the (UK) Now! series. It was only released on vinyl &amp; audio cassette. 
It was the fourth number one UK album in the series and stayed there for five weeks.
Now 5 features one song which reached number one on the UK Singles Chart: &quot;Frankie&quot;.


